function delayedAnimation(sprite, animName, delay) {
	setTimeout(function () { sprite.setAnimation(animName) }, delay)
	setTimeout(function() { sprite.destroy() }, delay + 800)
}

function initBalls(config, triangleBase, upsideDown) {
	var ballScale = 0.7;
	var step = 55 * ballScale;
	var counter = 0;
	for (var i = 0; i < triangleBase; i++) {
		for (var j = 0; j < triangleBase - i; j++) {
			var x = config.posX + i * step + 0.5 * step * j;
			var y
			if (!upsideDown) {
				y = config.posY + j * step;
			} else {
				y = config.posY - j * step;
			}

			var ballConfig = Object.assign({}, config)
			ballConfig.name = config.name + counter
			ballConfig.posX = x
			ballConfig.posY = y
			ballConfig.scaleX = ballScale
			ballConfig.scaleY = ballScale

			createSprite(ballConfig)

			counter++;
		}
	}
}

